import React, { Component } from 'react';

class Addquote extends Component {


    render() {
        return(
            <div > 
                <br></br>
            <h3 className="DevName" align="center">Add New Goals</h3>
                <hr></hr>
            <h5 align="center">No Goals to Display</h5>
        
            </div>
        
        )
    }
}

export default Addquote;
